(window.webpackJsonp=window.webpackJsonp||[]).push([[2049],{2404:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-767-ta-gap-qua-truong-huyen"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-767-ta-gap-qua-truong-huyen"}},[n._v("#")]),n._v(" Chương 767: Ta gặp qua Trương Huyền")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("br"),t("br"),n._v("Chương 767: Ta gặp qua Trương Huyền"),t("br"),t("br"),n._v("“Bao nhiêu?”"),t("br"),t("br"),n._v("Thấy đối phương mặt mũi cười khổ, có chút không dám tin tưởng bộ dáng, Đổng Hân kỳ quái: “Nếu là tân sinh, tu vi cao nhất cũng là tại Hợp Linh cảnh đỉnh phong, cho dù đột phá đến Kiều Thiên cảnh, một ngày thời gian, có thể chém giết ba đầu Hợp Linh cảnh đỉnh phong, là tốt lắm rồi, ba đầu... 120 điểm, chẳng lẽ, hắn còn có thể vượt qua một ngàn điểm?”"),t("br"),t("br"),n._v("Chém giết một đầu Hợp Linh cảnh sơ kỳ 10 điểm, đỉnh phong 40 điểm, một ngày có thể giết ba đầu cùng thực lực bản thân tương đồng liền rất lợi hại, coi như nhiều gấp mười lần, cũng chỉ một ngàn điểm mà thôi."),t("br"),t("br"),n._v("Không đến mức để đường đường Thương Nguyệt hội hội trưởng, lục tinh hạ phẩm danh sư, khiếp sợ như vậy chứ?"),t("br"),t("br"),n._v("“Một ngàn điểm? Nhưng mà ít như vậy, ta cũng không cần thiết như thế ngạc nhiên!”"),t("br"),t("br"),n._v("Biết đối phương không đoán ra được, Long Thương Nguyệt lắc đầu: “Hắn tổng cộng được bốn vạn 3,724 điểm...”"),t("br"),t("br"),n._v("“Bao nhiêu? Bốn, bốn... Hơn vạn điểm?”"),t("br"),t("br"),n._v("Thân thể mềm mại nhoáng một cái, Đổng Hân suýt chút nữa không ngã xuống đất ngất đi."),t("br"),t("br"),n._v("Nàng tự tay bắt qua những linh thú này, biết khó khăn."),t("br"),t("br"),n._v("Đây đều là nhiều lần đả thương người, làm nhiều việc ác gia hỏa, so lồng bên trong giam giữ những cái kia thú sủng hung mãnh nhiều, hơn nữa từng cái giảo hoạt, một cái vừa tới học viện tân sinh, thế mà được hơn bốn vạn điểm... Cái này trò đùa mở có chút lớn ah!"),t("br"),t("br"),n._v("Đến cùng là giết bao nhiêu linh thú, mới có thành tích như vậy?"),t("br"),t("br"),n._v("Chẳng lẽ khắp núi linh thú cũng bị hắn một người giết sạch?"),t("br"),t("br"),n._v("“Ừm, hơn nữa còn không phải chém giết linh thú nhận được, mà là... Thuần phục!” Long Thương Nguyệt nói."),t("br"),t("br"),n._v("“Thuần phục?” Đổng Hân thanh âm có chút chói tai."),t("br"),t("br"),n._v("Thuần phục so chém giết càng khó, coi như nàng loại này thuần thú học viện tiếng tăm lừng lẫy thiên tài, thuần phục một đầu, đều cần tốn hao mấy tháng, thậm chí mấy năm công phu, mới có thể để cho thân hòa độ đi đến tiêu chuẩn, một ngày không đến liền thuần phục... Hơn nữa, hơn bốn vạn điểm, đây là thuần bao nhiêu đầu?"),t("br"),t("br"),n._v("Dường như nhìn ra nàng nghi hoặc, Long Thương Nguyệt nói tiếp: “Tổng cộng thuần phục hơn bốn trăm đầu, hơn nữa... Nghe nói còn là tại trong vòng một canh giờ hoàn thành!”"),t("br"),t("br"),n._v("“Một canh giờ...” Đổng Hân nuốt ngụm nước bọt."),t("br"),t("br"),n._v("Loại năng lực này, liền xem như nàng, cũng làm không được."),t("br"),t("br"),n._v("“Được nhiều như vậy điểm, thuần phục nhiều như vậy linh thú, lập tức nhận được Mi viện trưởng ưu ái, muốn thu hắn làm đồ!” Long Thương Nguyệt nói."),t("br"),t("br"),n._v("“Thu hắn làm đồ? Mi viện trưởng muốn thu đồ?”"),t("br"),t("br"),n._v("Đổng Hân sửng sốt, nàng một mực cố gắng, mắt liền là muốn cho Mi viện trưởng thu đồ, đáng tiếc, vị này thập đại trường lão một trong lục tinh thượng phẩm danh sư, vẫn luôn không đáp ứng."),t("br"),t("br"),n._v("Vốn cho rằng, Mi viện trưởng cả đời cũng sẽ không thu đồ, không nghĩ tới bị vị này tân sinh đả động."),t("br"),t("br"),n._v("“Đúng vậy a, có điều, để cho người ta cảm thấy kỳ lạ nhất tính là... Cái tên này thế mà cự tuyệt!” Long Thương Nguyệt con mắt xoay loạn."),t("br"),t("br"),n._v("Lần đầu tiên nghe được tin tức này, hắn cũng là mộng."),t("br"),t("br"),n._v("Cự tuyệt thập đại trường lão một trong Mi viện trưởng... Cái tên này lá gan thật là lớn."),t("br"),t("br"),n._v("Đổng Hân càng là cảm thấy mình giống như đang nghe thiên thư."),t("br"),t("br"),n._v("Bao nhiêu người tranh muốn đoạt lấy làm đối phương học sinh, hắn cũng không thu, cái tên này cự tuyệt... Đầu óc có bị bệnh không?"),t("br"),t("br"),n._v("“Ngươi trước đừng kích động, càng tà tính còn ở phía sau, cái tên này nghe nói rất nhiều người không thông qua khảo hạch, một hơi đem bản thân nhận được điểm tích lũy đều đưa ra ngoài!” Long Thương Nguyệt nói."),t("br"),t("br"),n._v("“Đưa?”"),t("br"),t("br"),n._v("Đổng Hân nháy con mắt, lần nữa lắc lư hai lần: “Tân sinh nhập môn điểm tích lũy, là có thể dùng để hối đoái học phần... Những này điểm tích lũy, thật muốn hối đoái, nhận được mười cái học phần rất dễ dàng đi! Coi như đừng học phần, hối đoái linh thạch thượng phẩm, tùy tiện xin cái hai mươi viên, khẳng định cũng có thể cho... Vậy mà tặng người?”"),t("br"),t("br"),n._v("“Còn có thể hối đoái học phần cùng linh thạch?”"),t("br"),t("br"),n._v("Nàng bên này cảm khái, trong bụi cỏ Trương Huyền chỉ cảm thấy ngực sôi trào, suýt chút nữa không hộc máu, tại chỗ đã hôn mê."),t("br"),t("br"),n._v("Sớm biết cái đồ chơi này có thể hối đoái học phần, hối đoái linh thạch, rảnh rỗi da đau, tại đỉnh núi chơi đùa đến trưa, khẳng định sớm tiến lên, bắt linh thú!"),t("br"),t("br"),n._v("Một ngày làm sao không làm ra cái một trăm vạn, hai trăm vạn điểm?"),t("br"),t("br"),n._v("Thực sự không được, đem Tử Dương thú ném đi..."),t("br"),t("br"),n._v("Hợp Linh cảnh linh thú 10 điểm, Kiều Thiên cảnh 100 điểm, Quy Nhất cảnh 1000 điểm, Đạp Hư cảnh 10000 điểm, Tằm Phong cảnh 10 vạn điểm, Bán Thánh 1 triệu, Tòng Thánh 1000 vạn, Thánh vực dù thế nào... Cũng phải vượt qua một trăm triệu đi!"),t("br"),t("br"),n._v("Hơn nữa cái tên này là Thánh vực nhất trọng đỉnh phong, cũng chính là... Bốn trăm triệu điểm!"),t("br"),t("br"),n._v("Dựa theo tỉ lệ lời nói, có thể hay không một chút liền cho 10 vạn học phần? Hoặc là 20 vạn viên linh thạch thượng phẩm?"),t("br"),t("br"),n._v("Chỉ cảm thấy con mắt hoa mắt, Trương Huyền hối hận ruột cũng đen."),t("br"),t("br"),n._v("Thật muốn có thật nhiều học phần cùng linh thạch thượng phẩm lời nói, địa phương nào không đi được?"),t("br"),t("br"),n._v("Còn cần tiếp tục đợi tại cái chỗ chết tiệt này làm gì!"),t("br"),t("br"),n._v("Khẳng định đã sớm đi dạo hết Tàng Thư khố, đi phong hào đế quốc."),t("br"),t("br"),n._v("“Quay lại đi tìm một cái Mi trưởng lão, nhìn xem... Có thể hay không dùng Tử Dương thú đổi điểm tích lũy...”"),t("br"),t("br"),n._v("Trong lòng cực kỳ u oán, suy nghĩ một chút, đành phải bất đắc dĩ lắc đầu: “Không nói trước tân sinh khảo hạch kết thúc, coi như thật có thể hối đoái, Tử Dương thú như thế nào bị đánh, như thế nào bị bắt, cũng rất khó giải thích...”"),t("br"),t("br"),n._v("Dị nhân tộc khôi lỗi hiện nay là hắn lớn nhất dựa dẫm, không thể rò rỉ, mặc dù tràn đầy xoắn xuýt, suy nghĩ kỹ một chút, cũng chỉ có thể như vậy coi như không có gì."),t("br"),t("br"),n._v("“Nói thật, ngay cả ta cũng không thể không bội phục, cái tên này liền hào phóng như vậy!”"),t("br"),t("br"),n._v("Long Thương Nguyệt tiếp tục nói: “Đương nhiên, cái này cũng không tính là gì, ngươi nếu là biết phía sau hắn làm việc, khẳng định sẽ nổi điên!”"),t("br"),t("br"),n._v("“Ồ?” Nhịn xuống khiếp sợ, Đổng Hân lần nữa nhìn qua."),t("br"),n._v(" Hồ Yêu Yêu, Tiết Chân Dương hai người cũng không chen vào nói, có điều, trên mặt không có như vậy ngạc nhiên, chỉ sợ những việc này, trước đó liền biết."),t("br"),t("br"),n._v("“Cái tên này thông qua khảo hạch về sau, cùng ngày liền đi luyện khí sư học viện, kết quả, không biết làm sao kiếm, trực tiếp đem ghi chép thông đạo đều sập, thậm chí còn đem toàn bộ công hội điểm làm sập nửa bên...”"),t("br"),t("br"),n._v("Long Thương Nguyệt nói tiếp."),t("br"),t("br"),n._v("“Ghi chép thông đạo? Công hội phân bộ?” Đổng Hân hít vào một ngụm khí lạnh: “Nguyên Phó viện trưởng không giết hắn ư?”"),t("br"),t("br"),n._v("Làm học viện lão sinh, biết nguyên Phó viện trưởng tính khí, làm việc coi trọng quy củ, cương trực công chính."),t("br"),t("br"),n._v("Làm sập ghi chép thông đạo, thậm chí luyện khí sư công hội phân bộ nửa cái đại điện, không đem ngươi trở thành trận bóp chết là tốt lắm rồi."),t("br"),t("br"),n._v("“Giết hắn? Làm sao có thể... Không những không có giết, còn thái độ thật muốn mạng, tự mình mang theo hắn đi tham gia luyện khí sư khảo hạch! Kết quả, cái tên này hai canh giờ phía trong, từ luyện khí học đồ, thông qua khảo hạch, xong rồi... Lục tinh luyện khí sư!”"),t("br"),t("br"),n._v("Long Thương Nguyệt nói tiếp."),t("br"),t("br"),n._v("“Hai canh giờ... Từ nhất tinh kiểm tra đến lục tinh?” Đổng Hân hộc máu, cảm giác cũng nhịn không được nữa."),t("br"),t("br"),n._v("Trước đó sự tình, đều có thể tiếp nhận, thiên tài thật có, mạnh hơn bọn họ cũng không tính là gì, có thể hai canh giờ luyện khí sư từ nhất tinh kiểm tra đến lục tinh cái quỷ gì?"),t("br"),t("br"),n._v("Quan trọng hơn là, khảo hạch lục tinh danh sư, điều kiện tiên quyết là tu vi đi đến Hóa Phàm cửu trọng Tằm Phong cảnh, nếu không, chân khí độ tinh thuần không đủ, thôi thúc hỏa diễm nhiệt lượng không đủ, rất nhiều khoáng thạch là không cách nào luyện hóa."),t("br"),t("br"),n._v("Ngươi đây là cùng ta kể chuyện xưa chứ?"),t("br"),t("br"),n._v("“Chuyện này khiếp sợ Triệu viện trưởng, nhất định phải thay sư thu đồ, nhận hắn làm sư đệ... Kết quả cái tên này, lại cự tuyệt!”"),t("br"),t("br"),n._v("Biết nàng khó mà tin được, Long Thương Nguyệt biết giải thích cũng vô dụng, đem biết tin tức toàn bộ nói xong."),t("br"),t("br"),n._v("Trương Huyền tại luyện khí sư học viện chơi đùa sự tình, không ít học viên đều thấy được, không che giấu được, hơi hỏi thăm liền có thể biết rõ rõ ràng ràng."),t("br"),t("br"),n._v("“Mi viện trưởng thu đồ, Triệu viện trưởng nhận sư đệ... Cũng cự tuyệt?”"),t("br"),t("br"),n._v("Nuốt ngụm nước bọt, Đổng Hân nhìn qua: “Cái này tân sinh xác thực tà tính, nhưng mà... Hắn cùng các ngươi học hội kiếm tiền có quan hệ gì?”"),t("br"),t("br"),n._v("Vừa rồi để nàng kỳ quái là, tân sinh tới, bọn họ những này học hội, vì sao nói không có tiền, tiếp theo nói gia hỏa này, chẳng lẽ cùng bọn hắn không kiếm được tiền có quan hệ?"),t("br"),t("br"),n._v("“Đương nhiên có quan hệ! Ngươi cũng biết, tân sinh khai giảng, kiếm lợi nhiều nhất chính là bán ra 《 Giáo Chức Công Tế Giải 》, ai ngờ cái tên này, không biết từ nơi nào nhận được một phần càng thêm kỹ càng, càng thêm chuẩn xác, miễn phí đưa cho tân sinh... Ai còn mua sắm? Không chỉ không mua, còn đem chúng ta mắng chết, không ít nguyên vốn chuẩn bị gia nhập học hội tân sinh, cũng đều lui!”"),t("br"),t("br"),n._v("Long Thương Nguyệt cười khổ."),t("br"),t("br"),n._v("Chuyện này để Thương Nguyệt hội bị thiệt lớn, hắn mới chú ý tới vị này gọi Trương Huyền tân sinh, tra một cái phía dưới, nhận được nhiều như vậy tin tức."),t("br"),t("br"),n._v("Đổi lại những học sinh mới khác, khẳng định đã sớm ra tay cuồng đánh một trận, để hắn rõ ràng quy củ, có thể vị này... Mi viện trưởng, Triệu viện trưởng ước gì muốn nhờ người, coi như muốn động cũng không dám ah!"),t("br"),t("br"),n._v("“...”"),t("br"),t("br"),n._v("Đổng Hân há to mồm."),t("br"),t("br"),n._v("Xác thực, có miễn phí, hơn nữa càng tốt hơn, ai còn tốn hao một trăm linh thạch trung phẩm đi mua quý?"),t("br"),t("br"),n._v("“Cái kia... Chẳng lẽ không có cách nào?”"),t("br"),t("br"),n._v("“Có biện pháp nào? Cái tên này tu vi mặc dù không cao, nhưng phía sau có Mi viện trưởng cùng Triệu viện trưởng hai vị thập đại trường lão làm hậu thuẫn, thật không biết nên làm cái gì... Vừa vặn mấy người các ngươi cũng tại, đem chuyện này cũng thuận tiện thương nghị một chút!”"),t("br"),t("br"),n._v("Long Thương Nguyệt than thở một tiếng, trông mong nhìn qua: “Hắn tùy ý phá hư thị trường, làm chúng ta bị động như thế, nhất định phải cấp cho trừng phạt, nếu không, chúng ta tứ đại học hội mặt mũi đều sẽ mất sạch, lại không có người nghe!”"),t("br"),t("br"),n._v("“Đúng vậy a, nhất định phải trừng phạt!” Tiết Chân Dương cũng híp mắt lại, khẽ nói."),t("br"),t("br"),n._v("“Làm sao trừng phạt?” Đổng Hân nhìn qua."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Long Thương Nguyệt, Tiết Chân Dương nhìn nhau, từng người cười khổ."),t("br"),t("br"),n._v("Chỉ cần động cái tên này, Mi viện trưởng, Triệu viện trưởng chính là không vòng qua được đi khảm, nếu là có biện pháp, đã sớm xuất thủ, còn còn chờ tới bây giờ?"),t("br"),t("br"),n._v("“Nói đến cái tên này, ta hôm nay còn gặp mặt một lần!”"),t("br"),t("br"),n._v("Mọi người ở đây mặt mũi xoắn xuýt, không biết như thế nào cho phải thời điểm, một bên Hồ Yêu Yêu nhẹ nhàng cười một tiếng, mở miệng nói."),t("br"),t("br"),n._v("“Ngươi gặp?” Mấy người nhìn qua."),t("br"),t("br"),n._v("Mấy ngày nay bị vị này Trương Huyền đủ loại tin tức dọa đến gần chết, chân nhân nhưng chưa thấy qua."),t("br"),t("br"),n._v("Căn bản không biết vừa đến học viện, liền khuấy động dư luận xôn xao gia hỏa, đến cùng lớn lên cái gì bộ dáng."),t("br"),t("br"),n._v("“Ừm, năm thứ hai cái kia mỹ nữ thiên tài Lạc Thất Thất, chắc hẳn chư vị đều biết đi!”"),t("br"),t("br"),n._v("Hồ Yêu Yêu nhìn qua."),t("br"),t("br"),n._v("“Đương nhiên!” Đổng Hân gật đầu."),t("br"),t("br"),n._v("Nữ nhân đều chú trọng dung mạo, cùng là hoa khôi của trường trên bảng xếp hạng người, làm sao có thể không chú ý."),t("br"),t("br"),n._v("Vị này Lạc Thất Thất, muốn đi năm mới tiến vào học viện, dùng không đến thời gian một năm, liền từ tứ tinh đỉnh phong, thành ngũ tinh hạ phẩm, tốc độ tiến bộ kinh người."),t("br"),t("br"),n._v("“Ta vừa rồi nhìn thấy cùng vị này Trương Huyền cùng một chỗ, hơn nữa xưng hô hắn là lão sư!” Hồ Yêu Yêu nói."),t("br"),t("br"),n._v("“Lão sư?”"),t("br"),t("br"),n._v("“Lạc Thất Thất gọi lão sư hắn? Ngươi... Không có nói đùa chớ?”"),t("br"),t("br"),n._v("“Vị này Lạc Thất Thất lai lịch bí ẩn, nghe nói là cái nào đó đế quốc công chúa, có điều, ta hỏi thăm nhiều lần, cũng không được đến xác định ra tin tức... Loại người này, thế mà bái một cái tân sinh làm thầy?”"),t("br"),t("br"),n._v("Long Thương Nguyệt, Tiết Chân Dương đám người không thể tin được."),t("br"),t("br"),n._v("Convert by: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-775"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-777"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);